	@Inject
	public JavaFXLangGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pProjectFX = new ProjectFXElements();
		this.pControlFX = new ControlFXElements();
		this.pEString = new EStringElements();
		this.pModelFX = new ModelFXElements();
		this.pTableViewFX = new TableViewFXElements();
		this.pTableColumnFX = new TableColumnFXElements();
		this.pEInt = new EIntElements();
		this.pAttributeFX = new AttributeFXElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("de.dc.emf.javafx.xtext.JavaFXLang".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
